class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        n=len(board)
        m=len(board[0])
        L=[]
        for j in range (0,len(board)):
            for k in range (0,len(board[0])):
                L.append([board[j][k],j,k])
        L.sort(key=lambda x:x[0],reverse=True)
        count=min(len(L),2*(n+m))
        ans=-2**60
        M=[0]
        for j in range (1,len(L)):
            if len(M)==4:
                break
            if L[j][1]==L[0][1] or L[j][2]==L[0][2]:
                M.append(j)
        for j in M:
            for k in range (0,count):
                for l in range (k+1,count):
                    if j==k or k==l or l==j:
                        continue
                    if L[j][1]==L[k][1] or L[k][1]==L[l][1] or L[l][1]==L[j][1] or L[j][2]==L[k][2] or L[k][2]==L[l][2] or L[l][2]==L[j][2]:
                        continue
                    else:
                        ans=max(ans,L[j][0]+L[k][0]+L[l][0])
        return ans
